description:
Каждый путешественник знает, что знакомство с городом начинается с самого его сердца - нулевого километра, место положение Hostel Centre в этом активно способствует, так как находится в 250 метрах от данной достопримечательности города Волгограда, а так же его главной аллее, ведущей к центральной набережной, где проходят все масштабные мероприятия, и в шаговой доступности от вокзала.

«Hostel Centre» - это чистота, гостеприимство, уют и безопасность.
Наши апартаменты расположены в отдельно стоящем здании с площадью в 240 кв.м. и отдельной закрытой парковкой.

Для гостей  7 комнат, 5 четырех местных и 2 типа люкс со всеми необходимыми удобствами. В каждой комнате для поддержания комфортной температуры имеются сплит-системы. Так же в хостеле имеется современно оборудованная кухня, просторный санузел с шестью кабинами (3 туалетных комнат и 3 душевых), большим зеркалом и тремя умывальниками. Сердцем хостела является комната для отдыха Наших гостей, отделанная натуральным деревом и живыми растениями с большим и удобным 8 метровым диваном, где гости могут с комфортом посмотреть телевизор, поиграть в настольные игры или игровую приставку xbox360, а так же прочитать журнал или книгу.

Мы готовы организовать для Вас:
экскурсии по городу герою Волгограду,
посещение спектаклей в театры (муз комедию, НЭТ, молодежный театр, теат юного зрителя).

Мы находимся в самом центре города.Рядом с " Hostel Centre " расположены:
- Центральная набережная;
- Торговый центр «Пирамида»;
- Кулинария, множество кафе;
- Краеведческий музей;
-Площадь Павших борцов;
- Волгоградский  экспериментальный театр; 
- Молодежный театр; 
- Театр муз комедии;

- 10 минут  ходьбы от речного порта и железнодорожного вокзала и авто вокзала.

Hostel Centre не понаслышке знает, что вдали от дома нам хочется уюта. Именно поэтому, обещаем встречать вас со всем гостеприимством, которое только может быть присуще широкой русской душе.
Кроме того, мы будем рады личному общению с гостями из разных уголков России, а также нашими зарубежными друзьями! 
Мы с удовольствием поможем в организации вашего пребывания в городе.

